import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import TrainingLogManager from "./TrainingLogManager";

const manager = new TrainingLogManager();

export default function SavedTablesPage({ previewMode = false }) {
    const navigate = useNavigate();
    const [tables, setTables] = useState([]);

    useEffect(() => {
        const fetchTables = async () => {
            const result = await manager.listTables();
            setTables(result);
        };
        fetchTables();
    }, []);

    const handleNewTable = async () => {
        const newTable = manager.createNewTable();
        await manager.saveTable(newTable);
        navigate(`/log/${newTable.id}`);
    };

    const handleOpenTable = (id) => {
        navigate(`/log/${id}`);
    };

    const handleDeleteTable = async (id) => {
        if (window.confirm("Are you sure you want to delete this table?")) {
            await manager.deleteTable(id);
            setTables((prev) => prev.filter((table) => table.id !== id));
        }
    };

    return (
        <div
            style={{
                padding: "2rem",
                paddingTop: previewMode ? "1rem" : "4rem", // Reduced padding for better spacing
                background: "#000",
                minHeight: previewMode ? "auto" : "100vh",
                color: "#f5f6fa",
                position: "relative"
            }}
        >
            {/* Back to Dashboard Button */}
            {!previewMode && (
                <button
                    onClick={() => navigate("/")}
                    style={{
                        position: "fixed", // Changed to fixed for consistency
                        top: "1rem",
                        left: "1rem",
                        background: "#31363f",
                        color: "#ffd966",
                        padding: "0.7rem 1.4rem",
                        border: "none",
                        borderRadius: "10px",
                        fontWeight: "600",
                        fontSize: "1rem",
                        cursor: "pointer",
                        zIndex: 1000,
                        transition: "background 0.2s"
                    }}
                    onMouseOver={e => e.currentTarget.style.background = "#444950"}
                    onMouseOut={e => e.currentTarget.style.background = "#31363f"}
                >
                    ‚Üê Back to Dashboard
                </button>
            )}

            {!previewMode && (
                <>
                    <h1 style={{ 
                        fontSize: "2.5rem", 
                        marginBottom: "1.5rem",
                        color: "#ffd966"
                    }}>
                        Saved Training Logs
                    </h1>
                    <button
                        onClick={handleNewTable}
                        style={{
                            background: "#31363f",
                            color: "#ffd966",
                            padding: "0.8rem 1.6rem",
                            border: "none",
                            borderRadius: "10px",
                            fontWeight: "600",
                            fontSize: "1rem",
                            cursor: "pointer",
                            marginBottom: "2rem",
                            transition: "background 0.2s"
                        }}
                        onMouseOver={e => e.currentTarget.style.background = "#444950"}
                        onMouseOut={e => e.currentTarget.style.background = "#31363f"}
                    >
                        + New Table
                    </button>
                </>
            )}

            {tables.length === 0 ? (
                <p style={{ 
                    opacity: 0.7,
                    fontSize: "1.1rem",
                    textAlign: "center",
                    marginTop: "2rem"
                }}>
                    No saved tables yet.
                </p>
            ) : (
                <ul style={{ listStyle: "none", padding: 0 }}>
                    {tables.map((table) => (
                        <li
                            key={table.id}
                            style={{
                                marginBottom: "1rem",
                                padding: "1rem",
                                background: "#1e1e1e",
                                borderRadius: "12px",
                                display: "flex",
                                justifyContent: "space-between",
                                alignItems: "center",
                                border: "1px solid #333",
                                transition: "transform 0.2s, border-color 0.2s"
                            }}
                            onMouseEnter={(e) => {
                                e.currentTarget.style.transform = "translateY(-2px)";
                                e.currentTarget.style.borderColor = "#ffd966";
                            }}
                            onMouseLeave={(e) => {
                                e.currentTarget.style.transform = "translateY(0)";
                                e.currentTarget.style.borderColor = "#333";
                            }}
                        >
                            <div 
                                style={{ 
                                    cursor: "pointer",
                                    flex: 1,
                                    paddingRight: "1rem"
                                }} 
                                onClick={() => handleOpenTable(table.id)}
                            >
                                <strong style={{ fontSize: "1.1rem" }}>{table.tableName}</strong>
                                <br />
                                <em style={{ opacity: 0.7 }}>{table.date}</em>
                            </div>
                            {!previewMode && (
                                <button
                                    onClick={() => handleDeleteTable(table.id)}
                                    style={{
                                        background: "#ff4d4f",
                                        color: "#fff",
                                        border: "none",
                                        borderRadius: "8px",
                                        padding: "0.5rem 1rem",
                                        cursor: "pointer",
                                        fontWeight: "600",
                                        transition: "background 0.2s"
                                    }}
                                    onMouseOver={e => e.currentTarget.style.background = "#ff7875"}
                                    onMouseOut={e => e.currentTarget.style.background = "#ff4d4f"}
                                >
                                    Delete
                                </button>
                            )}
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
}
